(164, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:44:\"Introducing New Color Picker &amp; Dark Mode\";s:7:\"excerpt\";s:147:\"Today, we introduce colorful new features to Elementor: Dark Mode, a new color picker and more responsive improvements to streamline your workflow.\";s:7:\"created\";s:10:\"1575902465\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:124:\"https://elementor.com/blog/introducing-color-picker/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:79:\"WordPress Rich Snippets Guide: Everything You Need to Know (Including Plugins) \";s:7:\"excerpt\";s:148:\"In this post, we\'ll cover everything you need to start getting rich snippets for your site, as well as review 5 of the leading Rich Snippet addons. \";s:7:\"created\";s:10:\"1574751419\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:113:\"https://elementor.com/blog/rich-snippets/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:50:\"Coming Soon  Black Friday and Cyber Monday 2019\";s:7:\"excerpt\";s:102:\"We are super excited to announce that weve prepared something extraordinary for this Black Friday. \";s:7:\"created\";s:10:\"1574338433\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:124:\"https://elementor.com/blog/black-friday-coming-soon/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:59:\"What Online Businesses Need to Know and Do for Black Friday\";s:7:\"excerpt\";s:220:\"With Black Friday/Cyber Monday weekend fast upon us, we\'ve put together a checklist and a cheat sheet so that we can enjoy Thanksgiving Dinner with our families, and rest easy knowing that weve got everything covered.\";s:7:\"created\";s:10:\"1574163835\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/black-friday-marketing/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:40:\"Podcast #53: Building Affiliate Websites\";s:7:\"excerpt\";s:204:\"Ariel Hochstadt, the co-founder of vpnMentor and Website Planet, tells us why he left Google to found his own enterprise, explains how to convey transparency, and shares his tips for novice affiliates.\";s:7:\"created\";s:10:\"1573737194\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:126:\"https://elementor.com/blog/podcast-53-ariel-hochstadt/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
